import logo_main from './footer-logo.png'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo_main}  alt="logo" />
        <br></br>
        <a
          className="logo_main"
          href="https://loftitsolutions.com/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React From LOFTfadsf
        </a>
      </header>
    </div>
  );
}

export default App;
